import React from "react";
import {Link} from "react-router-dom";


class Aboutpage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      brand: 'Chevy',
      model: 'Malibu',
      color: 'Black',
      license: 'IGX-621',
      year: 2014,
    };
  }
  changeColor = () => {
    this.setState({color: 'Blue'});
  }
  render() {
    return (
      <div>
        <h1>{this.state.license}</h1>
        <Link  to='/'>Go to Aboutpage</Link>
      </div>
       
    );
  }
}
